{
  "extends": [
    "@commitlint/config-conventional"
  ],
  "rules": {
    "type-enum": [
      2,
      "always",
      [
        "chore",
        "docs",
        "feat",
        "fix",
        "refactor",
        "release"
      ]
    ]
  }
}

{
  "path": "cz-conventional-changelog",
  "types": {
    "chore": {
      "description": "Any other change that doesn't modify source files",
      "title": "Chore"
    },
    "docs": {
      "description": "Documentation only changes",
      "title": "Documentation"
    },
    "release": {
      "description": "A commit intended for publishing a new release",
      "title": "Release"
    },
    "feat": {
      "description": "A code change that implements a new feature",
      "title": "Feature"
    },
    "fix": {
      "description": "A code change that implements a bug fix",
      "title": "Fix"
    },
    "refactor": {
      "description": "A code change that neither fixes a bug nor adds a feature",
      "title": "Refactor"
    }
  }
}

{
  "projects": {
    "default": "comettools-lunasea"
  }
}

{
  "skip": {
    "bump": true
  },
  "types": [
    {
      "type": "chore",
      "hidden": true
    },
    {
      "type": "docs",
      "hidden": true
    },
    {
      "type": "feat",
      "section": "Features"
    },
    {
      "type": "fix",
      "section": "Bug Fixes"
    },
    {
      "type": "refactor",
      "section": "Tweaks"
    }
  ],
  "releaseCommitMessageFormat": "release: v{{currentTag}}\n\n[skip ci]"
}

